def find_word(b, word):
    for col in col_search_pattern:
        s = ""
        for coord in col:
            s += b[coord]
        if word in s or word[::-1] in s:
            print("Found word: " + word + " in column " + str(col))
            return True

    for row in row_search_pattern:
        s = ""
        for coord in row:
            s += b[coord]
        if word in s or word[::-1] in s:
            print("Found word: " + word + " in row " + str(row))
            return True

    for diag in l_diagonal_search_pattern:
        s = ""
        for coord in diag:
            s += b[coord]
        if word in s or word[::-1] in s:
            print("Found word: " + word + " in diagonal " + str(diag))
            return True

    for diag in r_diagonal_search_pattern:
        s = ""
        for coord in diag:
            s += b[coord]
        if word in s or word[::-1] in s:
            print("Found word: " + word + " in diagonal " + str(diag))
            return True

    print("Did not find word: " + word + " in board")
    return False

